const addDetailsName = (name) => {
    return {
        type: "details/name",
        payload: name
    }
}

const addDetailsEmail = (email) => {
    return {
        type: "details/email",
        payload: email
    }
}

const addDetailsDOB = (dob) => {
    return {
        type: "details/DOB",
        payload: dob
    }
}

const addDetailsContact = (tel) => {
    return {
        type: "details/tel",
        payload: tel
    }
}

const addDetailsVisited = (visited) => {
    return {
        type: "details/visited",
        payload: visited
    }
}

const addDetailsCondition = (condition) => {
    return {
        type: "details/condition",
        payload: condition
    }
}

const addTiming = (timing) => {
    return {
        type: "timing",
        payload: timing
    }
}

export { addDetailsName, addDetailsEmail, addDetailsContact, addDetailsDOB, addDetailsVisited, addDetailsCondition, addTiming };
